B.aOa=new A.n("Material Design 2 guide mentions using surfaces with primary color alpha blends. FlexColorScheme surface blends does it for you.\n\nMaterial Design 3 has a new color system where a hint of primary color is also used on surfaces. It is done via its neutral tonal palettes that are shifted slightly towards the primary color. If you use M3 seeded ColorSchemes, set blend level to zero to get the pure M3 design. With surface blends, you can further strengthen the effect and vary blend levels by surface type.\n\nWhen using a surface blend mode with a high factor on Scaffold background, the design intent is to not place any controls and text on it directly, but to always use them on other surfaces with less surface tint. For example in Cards, like this application does. The Scaffold background is then only used as a background effect.",null,null,null,null,null,null,null,null,null,null)
